<>
    <div className='wrapper'>
      <div className='box'>{
        user ? (
          <>
            <button className=' btn btn-primary btn-md' onClick={handleLogOut}>
              log out</button>
            <h3>{user.displayName}</h3>
            <p>{user.email}</p>
            <div className='photo'>
              <img src={user.photoURL} alt='dp'></img>
            </div>
          </>
        ) : (
          <button className=' btn btn-primary' onClick={handleGoogleSignIn}>
            Google signin
          </button>

        )}

      </div>
    </div>
</>


 );
}

export default App;
